import React from "react";
import logo from "../src/Images/logo.png";
import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";





function App() {
  return (
   <ul id="nav">
	<li><a href="#">Home</a></li>
	<li><a href="#">View Templates</a></li>

	<li><a className="right" href="#">Log In</a></li>
	<li><a className="right" href="#">Sign Up</a></li>
	<li><a className="right" href="#">Contact Us</a></li>
</ul>
  )
}

export default App;
